
class Solution:
    def findAnagrams(self, s: str, p: str) -> 'List[int]':
        n = len(p)
        ns = len(s)
        res = []
        if ns < n:
            return res
        table = {}
        for pp in p:
            if pp in table:
                table[pp] += 1
            else:
                table[pp] = 1

        for i in range(ns - n + 1):
            stable = {}
            for ss in s[i:i + n]:
                if ss in stable:
                    stable[ss] += 1
                else:
                    stable[ss] = 1
            # sort_stable = sorted(stable.items(), key=lambda x:x[0])
            # sort_table = sorted(table.items(), key=lambda x:x[0])
            # 排序或许超时
            # # print(sort_stable, sort_table)
            # if sort_stable == sort_table:
            #     res.append(i)
            flag = False
            for k, v in table.items():
                if k in stable and stable[k] == v:
                    flag = True
                else:
                    flag = False
                    break
            if flag:
                res.append(i)
        return res
    # 上面的那种方法仍旧超时，但是结果是对的，
    # 采用下面的前后双指针的方法，滑动窗口， 复杂度为 2* len(s)
    def findAnagrams2(self, s: str, p: str) -> 'List[int]':
        res = []
        left, right = 0, 0
        needs = {}
        window = {}
        for c in p:
            if c not  in needs:
                needs[c] = 1
            else:
                needs[c] += 1
        match = 0
        while right < len(s):
            cha = s[right]
            if cha in needs:
                if cha not in window:
                    window[cha] = 1
                else:
                    window[cha] += 1
                if window[cha] == needs[cha]:
                    match += 1
            right += 1

            while match == len(needs):
                if right - left == len(p):
                    res.append(left)
                cc = s[left]
                if cc in needs:
                    window[cc] -= 1
                    if window[cc] < needs[cc]:
                        match -= 1
                left += 1
        return res
    # 滑动窗口
    def findAnagrams3(self, s: str, p: str) -> 'List[int]':

        if len(p) > len(s):
            return []

        s_map, p_map = [0] * 128, [0] * 128
        for i in range(len(p)):
            s_map[ord(s[i])], p_map[ord(p[i])] = s_map[ord(s[i])] + 1, p_map[ord(p[i])] + 1
        print(s_map)
        print(p_map)
        res = []
        if s_map == p_map:
            res.append(0)

        for i in range(1, len(s) - len(p) + 1):
            s_map[ord(s[i + len(p) - 1])] += 1  # 窗口向右移动一个，左边的字符数量-1，右边的字符数量+1
            s_map[ord(s[i - 1])] -= 1
            if s_map == p_map:
                res.append(i)

        return res


    # 由于是小写字母，所以上面的方法可以优化
    def findAnagrams4(self, s: str, p: str) -> 'List[int]':
        if not p or not s: return []

        m = len(s)
        n = len(p)
        if m < n:
            return []
        s1 = [0] * 26
        s2 = [0] * 26
        for i in range(n):
            # p中各字母频度
            s2[ord(p[i]) - 97] += 1
        for i in range(n - 1):
            # 定义一个len(p)-1大小的滑动窗口，统计窗口内单词频度
            s1[ord(s[i]) - 97] += 1
        result = []
        for i in range(m - n + 1):
            # 窗口大小+1
            s1[ord(s[i + n - 1]) - 97] += 1
            # 窗口大小-1(即原始窗口向右滑动一格）
            if s1 == s2:
                result.append(i)
            s1[ord(s[i]) - 97] -= 1

        return result
